import logo from './logo.svg';
import './App.css';
import Button from "./components/CustomButtonComponent";

function Button_Recom_CB() {
  return(
    <div>
      <h2>Content Based Recommender System</h2>
    </div>

  );
}

function Button_Recom_CF() {
  return(
    <div>
      <h2>Collaborative Filtering</h2>
    </div>

  );
}


function App() {
  return (                                // render is a method of react that displays on screen, return is for js
    <div className="App">
      <h1>Music Recommendation System Evaluation</h1>
      <Button_Recom_CB/>
      <Button_Recom_CF/>
      <Button
        border="groove"
        color="pink"
        height = "200px"
        onClick={() => console.log("You clicked on the pink circle!")}
        radius = "50%"
        width = "200px"
        children = "I'm a pink circle!"
      />
    </div>
  );
}

export default App;
